import React, { Component } from 'react';

class Rows extends Component {
    render() {
        return (
            <tr>
                <td style={{textAlign: "center"}}>{this.props.customerName}</td>
                <td style={{textAlign: "center"}}>{this.props.country}</td>
                <td style={{textAlign: "center"}}>{this.props.code}</td>
                <td style={{textAlign: "center"}}>{this.props.phone}</td>
                <td style={{textAlign: "center"}}>{this.props.state}</td>
            </tr>
        );
    }
}

export default Rows;
